import tensorflow as tf
import os
import PIL
import numpy as np
import matplotlib.pyplot as plt
import matplotlib.image as mpimg
from PIL import Image
from PIL.Image import ANTIALIAS
import io

app = Flask(__name__)
CLASS_NAMES = ['cardboard', 'glass', 'metal', 'paper', 'plastic', 'trash']


@app.route('/api/predict/', methods=['GET', 'POST'])
def image_predict():
    return "Predict"


def get_prediction_image(image64):
    model = __load_model()
    img = __prepocess_img(image64)
    img_array = tf.keras.utils.img_to_array(img)
    img_array = tf.expand_dims(img_array, 0)  # Create a batch
    predictions = model.predict(img_array)
    print(predictions[0])

    print(
        f"{CLASS_NAMES[np.argmax(predictions[0])]} with a {np.max(predictions[0])} percent confidence.")

    return [np.argmax(predictions[0]), np.max(predictions[0])]


def __prepocess_img(image64):
    # image = image64
    image = base64.b64decode(image64)
    image = Image.open(io.BytesIO(image))
    image = image.resize((180, 180), Image.ANTIALIAS).convert('RGB')
    return image


def __load_model():
    # change the path according to the environment
    model_dir = os.path.join(os.getcwd(), 'api-services-model', 'model_ml')
    model_name = 'trash-classification.h5'
    model_path = os.path.join(model_dir, model_name)
    model = tf.keras.models.load_model(model_path)
    return model


